import './App.css';

import { Hero } from './Hero.jsx';
import { AppList } from './AppList';
import { useState } from 'react';
import { SelectedApp } from './SelectedApp';

import 'bootstrap/dist/css/bootstrap.css';

function App() {
  const [selectedApp, setApp] = useState(null);

  return (
    <div>
      <Hero></Hero>

      {selectedApp ? (<SelectedApp appName={selectedApp} onBackClick={() => setApp(null)} children=' I am a text child node for children prop'>
       
      </SelectedApp>) : (<AppList setApplication={setApp} />
  )
}
      
    </div>
  );
}

export default App;
